import React, { useState } from "react";
import Table from "react-bootstrap/Table";
import PropTypes from "prop-types";
import SortTransactionMenu from "../Components/SortTransactionMenu";
import axios from "axios";

// DISPLAY TRANSACTION
const DisplayTransactionModal = ({ WEMES_URL, index }) => {
  console.log("TRANSACTION CLICK");
  console.log(WEMES_URL, index);

  axios
    .get(`${WEMES_URL}transactions/${index + 1}/`)
    .then((response) => {
      console.log(response.data);
    })
    .catch((err) => {
      alert(err);
    });

  return (<Modal
    {...props}
    size="lg"
    aria-labelledby="contained-modal-title-vcenter"
    centered
  >
    <Modal.Header closeButton>
      <Modal.Title id="contained-modal-title-vcenter">
        Add New Transaction
      </Modal.Title>
    </Modal.Header>
    <Modal.Body>
      <Form size="lg" onSubmit={submitTransactionData}>
        <Form.Group className="mb-3" controlId="formDropOff">
          <Form.Label>Drop Off Date</Form.Label>
          <Form.Control
            type="date"
            placeholder="12/12/22"
            onChange={(event) =>
              setTransactionData({
                ...transactionData,
                drop_off: event.target.value,
              })
            }
          />
          <Form.Text className="text-muted"></Form.Text>
        </Form.Group>

        <Form.Group className="mb-3" controlId="formAdmin">
          <Form.Label>Your Name</Form.Label>
          <Form.Control
            type="name"
            placeholder="Who are you?"
            onChange={(event) =>
              setTransactionData({
                ...transactionData,
                admin: event.target.value,
              })
            }
          />
          <Form.Text className="text-muted"></Form.Text>
        </Form.Group>

        <Form.Group className="mb-3" controlId="formCustomer">
          <Form.Label>Customer</Form.Label>
          <Form.Control
            type="text"
            name="customer"
            placeholder="Customer"
            onChange={(event) =>
              setTransactionData({
                ...transactionData,
                customer: event.target.value,
              })
            }
          />
        </Form.Group>

        <Form.Group className="mb-3" controlId="formDescription">
          <Form.Label>Description</Form.Label>
          <Form.Control
            type="description"
            placeholder="Leave a Note"
            onChange={(event) =>
              setTransactionData({
                ...transactionData,
                description: event.target.value,
              })
            }
          />
          <Form.Text className="text-muted"></Form.Text>
        </Form.Group>

        <Form.Group className="mb-3" controlId="formItems">
          <Form.Label>Items</Form.Label>
          <Form.Control type="text" placeholder="" disabled />
          <Form.Text className="text-muted"></Form.Text>
        </Form.Group>

        {/* <Form.Group className="mb-3" controlId="formBasicCheckbox">
      <Form.Check type="checkbox" value="false" label="Check me out" />
    </Form.Group> */}

        <Button variant="warning" type="submit" onClick={props.onHide}>
          Submit
        </Button>
      </Form>
    </Modal.Body>
  </Modal>);
};

const TransactionsList = ({ transactionData, WEMES_URL }) => {
  const [selectedTransaction, setSelectedTransaction] = useState({});
  const [sortBy, setSortBy] = useState("id");
  const [orderBy, setOrderBy] = useState("desc");

  const selectTransaction = (transactionId) => {
    for (const transaction of transactionData) {
      if (transaction.id === transactionId) {
        setSelectedTransaction(transaction);
      }
    }
  };

  const sortedTransactions = transactionData.sort((a, b) => {
    let order = orderBy === "asc" ? 1 : -1;
    let sortByA = sortBy === "id" ? a[sortBy] : a[sortBy];
    let sortByB = sortBy === "id" ? b[sortBy] : b[sortBy];
    return sortByA < sortByB ? -1 * order : 1 * order;
  });

  // const displayTransaction = () => {
  //   return sortedTransactions.map((transaction, index) => {
  //     return (
  //       (
  //         <li
  //           className={
  //             transaction.id === selectedTransaction.id
  //               ? "transaction-menu-item__selected"
  //               : null
  //           }
  //           key={index}
  //           onClick={() => selectTransaction(transaction.id)}
  //         >
  //           {transaction.customer}
  //         </li>
  //       ),
  //       (<li>{transaction.customer}</li>)
  //     );
  //   });
  // };

  const transactionInfo = () => {
    return transactionData.map((transaction, index) => (
      // <a href="#">
      // <tr>
      <tr
        key={index}
        onClick={() => DisplayTransactionModal({ WEMES_URL, index })}
      >
        {/* <td><a href="./">{transaction.id}</a></td> */}
        <td>{transaction.customer}</td>
        <td>{transaction.admin}</td>
        <td>{transaction.drop_off}</td>
        <td>{transaction.description}</td>
        <td>{transaction.items.length}</td>
      </tr>
    ));
  };

  return (
    <>
      <div>
        <SortTransactionMenu
          sortBy={sortBy}
          onSortByChange={(sortOption) => {
            setSortBy(sortOption);
          }}
          orderBy={orderBy}
          onOrderByChange={(orderOption) => {
            setOrderBy(orderOption);
          }}
        />
      </div>
      <Table striped hover>
        <thead>
          <tr>
            <th>Customer</th>
            <th>Admin</th>
            <th>Dropped Off</th>
            <th>Message</th>
            <th>Items</th>
          </tr>
        </thead>
        <tbody>{transactionInfo()}</tbody>
      </Table>
    </>
  );
};

TransactionsList.propTypes = {
  transactions: PropTypes.array,
};

export default TransactionsList;
